import React from 'react';

class Card extends React.Component {

    cardClicked = () => {
		console.log('success')
    }

    render() {
        return (
            <div className="card">
                <div className="card-content">
                    <div className="content" onClick={this.cardClicked}>
                        {this.props.cityName}
                    </div>
                </div>
            </div>
        )
    }
}

export default Card;
